    html_product_description: "<div id=\"productDescription\" class=\"a-section a-spacing-small\">          <!-- show up to 2 reviews by default -->\n               <h3> <span>Product Description</span> </h3>        <p> <span>Keep your playful puppy happy by supporting his dietary needs with Purina Pro Plan Brand Dog Food Puppy Lamb and Rice Formula dry puppy food. Real lamb as the first ingredient helps provide protein, one of the essential building blocks your puppy's body requires, and DHA from fish oil nourishes his brain and vision development. With no artificial colors or flavors, each high-quality ingredient is carefully chosen for a specific nutritional or functional purpose, so each puppy kibble nibble delivers maximum nutritional impact. The highly digestible formula promotes nutrient bioavailability to deliver optimal nutrient absorption. This formula is formulated to meet the nutritional needs of puppies under 1 year old, and the lamb and rice dog food formula makes each bite one that encourages him to wag his tail. Make this formula part of his daily diet, and give your puppy what he needs to live an exceptional life.</span>  </p>          <h3> <span>Amazon.com</span> </h3>        <p> <span>From the moment we wake up each morning, to the instant we pull into our driveways at the end of each day &#8211; our dogs are there, offering the one-of-a-kind commitment only they can provide.</span></p><p><span>That&#8217;s why we want to do more to give back to our dogs in every way we can.</span><span class=\"a-text-bold\">Pro Plan&#174; Puppy Lamb &amp; Rice Formula</span><span> is a dry food that has been specially formulated to meet the nutritional needs of developing puppies. The Puppy Lamb &amp; Rice Formula from Pro Plan&#174; is made with real Australian and New Zealand lamb (raised without hormones) as the #1 ingredient, as well as OptiStart&#174; easy-to-digest, natural milk proteins to help support your puppy&#8217;s developing immune system.Pro Plan&#174; Puppy Lamb &amp; Rice Formula Supports:Brain and Vision DevelopmentWith DHA, an omega-3 fatty acid, also found in mothers&#8217; milk.Healthy Heart With high-quality protein along with essential vitamins and minerals.Strong Immune SystemWith complete nutrition with high levels of antioxidants and quality protein, including real lamb.Healthy Digestive SystemWith a highly digestible formula that includes wholesome rice and easy-to-digest natural milk proteins.Radiant Skin and CoatWith vitamin A and high-quality protein combined with linoleic acid, an omega-6 fatty acid.Strong Teeth and BonesWith calcium, phosphorus, and other minerals--as well as a hard kibble texture that helps reduce plaque build-up on teeth.Optimal WeightWith the appropriate protein to fat ratio to help maintain ideal body condition.Exceptional FlavorWith high-quality ingredients, beginning with real lamb, as the #1 ingredient.</span><span class=\"a-text-bold\">About Pro Plan&#174; from Purina&#174;</span><span><br/>\nPassionate pet owners strive to do more for their dogs and cats in any way they can. That&#8217;s why Pro Plan&#174; has created a complete line of dog and cat food made with high-quality ingredients for outstanding nutrition and taste, in a variety of formulas to help meet your pet&#8217;s unique needs based on life stage, lifestyle, and breed size.</span></p>              </div>",
