export function useGetProducts(account_id) {
  const [data, setData] = useState(localData); // Set localData as the initial state
  const [filteredData, setFilteredData] = useState([]); // Initialize filteredData as an empty array

  const [isLoading, setIsLoading] = useState(false); // No need to start loading when using local data
  const [fetchError, setFetchError] = useState(null);
  useEffect(() => {
    const fetchData = async () => {
      setIsLoading(true); // Set loading to true when fetching data
      try {
        // Find the organization based on the account_id
        const organization = organizations.find(org => org.id === account_id);
        if (!organization) {
          throw new Error('Organization not found');
        }

        // Filter localData based on the organization's products list
        const filteredProducts = localData.filter(item => organization.products.includes(item.asin));

        setFilteredData(filteredProducts);
      } catch (error) {
        setFetchError(error); // Set fetch error if there's an error during filtering
      } finally {
        setIsLoading(false); // Set loading to false after fetching is done
      }
    };

    fetchData(); // Call fetchData function when account_id changes
  }, [account_id]);

  const memoizedValue = useMemo(() => ({
    products: filteredData || [], // Use filteredData directly
    isLoading,
    error: fetchError,
    isEmpty: !isLoading && filteredData.length === 0, // Check if filteredData is empty
  }), [filteredData, isLoading, fetchError]);

  return memoizedValue;
}


